import React from "react";

const AboutSection = () => {
  return (
    <div className="about-section">
      <h1>About Our Team</h1>
      <p>
        At our practice, we do things differently. We are an ambitious and smart
        team with a shared mission: to provide the best possible care for our
        patients.
      </p>
      <p>
        We care deeply about the well-being of our patients and take pride in
        the work that we do. We go above and beyond to ensure that each and
        every one of our patients receives the highest level of care.
      </p>
      <p>
        We know that healthcare can be a daunting and overwhelming experience,
        but we are here to make it as smooth and stress-free as possible. Our
        team is dedicated to doing the impossible in order to provide the best
        possible outcome for our patients.
      </p>
    </div>
  );
};

export default AboutSection;
